        private NeedleWork2016Context _context;

        public UsersPDFsController(NeedleWork2016Context context)
        {
            _context = context;    
        }

        // GET: UsersPDFs
        public IActionResult Index()
        {
            var needleWork2016Context = _context.UsersPDF.Include(u => u.IdUserNavigation);
            return View(needleWork2016Context.ToList());
        }

        // GET: UsersPDFs/Details/5
        public IActionResult GetPDFReportFromDatabase(int? id)
        {
            if (id == null)
            {
                return HttpNotFound();
            }

            UsersPDF usersPDF = _context.UsersPDF.Single(m => m.Id == id);
            if (usersPDF == null)
            {
                return HttpNotFound();
            }
            FileResult fileResult = new FileContentResult(usersPDF.PdfData, "application/pdf");

            fileResult.FileDownloadName = "Embroidery.pdf";

            return fileResult;   
        }

